import './Loader.css';

const Loader = () => {

    return (
        <div className="loader-wrapper">
            <svg className="rain-loader" width="353" height="299" viewBox="0 0 353 299" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path id="cloud" d="M78.5223 219.646C-19.4777 219.646 -0.477737 121.646 53.5223 116.646C10.5223 15.646 152.522 -31.354 199.522 51.646C233.522 21.646 322.522 45.646 300.522 121.646C335.522 116.646 357 152 335.522 179.646C341.5 191 338.5 219.646 300.522 219.646" stroke="white" stroke-width="17" stroke-linecap="round"/>
                <line id="raindrop1" x1="109.384" y1="195.092" x2="135.59" y2="267.093" stroke="white" stroke-width="17" stroke-linecap="round"/>
                <line id="raindrop3" x1="248.895" y1="187.08" x2="278.919" y2="269.572" stroke="white" stroke-width="17" stroke-linecap="round"/>
                <line id="raindrop2" x1="171.895" y1="175.08" x2="212.927" y2="287.816" stroke="white" stroke-width="17" stroke-linecap="round"/>
            </svg>
        </div>
    )
}

export default Loader;
